import React, { useEffect, useState, useContext } from "react";
import axios from "axios";
import "../css/page/HomePage.css";
import ProfileHeader from "../components/page/PageHeader";
import { DataContext } from "../DataContext";
import { useNavigate } from "react-router-dom";

export default function HomePage() {
  const [products, setProducts] = useState([]);
  const [user, setUser] = useState(null);

  const navigate = useNavigate();
  const { token, setToken } = useContext(DataContext);

  /** N·∫øu kh√¥ng c√≥ token => quay l·∫°i Login */
  useEffect(() => {
    if (!token) navigate("/login");
  }, [token]);


  /** GET CURRENT USER */
  useEffect(() => {
    if (!token) return;

    axios
      .get("http://localhost:8080/api/auth/user/me", {
        headers: { Authorization: `Bearer ${token}` },
      })
      .then((res) => {
        if (res.data && res.data.data) {
          setUser(res.data.data);
        }
      })
      .catch((err) => console.log("== user error ==", err.response?.data));
  }, [token]);


  /** GET PRODUCTS */
  useEffect(() => {
    if (!token) return;

    axios
      .get("http://localhost:8080/api/products", {
        headers: { Authorization: `Bearer ${token}` },
      })
      .then((res) => setProducts(res.data.data))
      .catch((err) => console.log(err));
  }, [token]);


  /** LOGOUT */
  const handleLogout = () => {
    setToken(null);                        // clear context
    localStorage.removeItem("trip-token"); // clear local storage
    window.location.href = "/login";       // force redirect
  };


  return (
    <div className="hp-container">
      
      <ProfileHeader
        user={user}
        onLogout={handleLogout}
      />

      {/* Banner */}
      <section className="hp-banner">
        <div className="hp-banner-slide">üî• Khuy·∫øn m√£i c·ª±c s·ªëc!</div>
      </section>

      {/* Category */}
      <section className="hp-category">
        <div className="hp-cat-item">üì± ƒêi·ªán tho·∫°i</div>
        <div className="hp-cat-item">üíª Laptop</div>
        <div className="hp-cat-item">üéß √Çm thanh</div>
        <div className="hp-cat-item">üì∫ TV</div>
      </section>

      {/* Flash sale */}
      <section className="hp-section">
        <h2>üî• FLASH SALE</h2>

        <div className="hp-scroll-row">
          {products.map((p) => (
            <div key={p.id} className="hp-flash-card">
              <img src={p.images[0]?.imageUrl} alt={p.name} />
              <div className="hp-name">{p.name}</div>
              <div className="hp-price">{p.price.toLocaleString()} ‚Ç´</div>
            </div>
          ))}
        </div>
      </section>

      {/* Grid */}
      <section className="hp-section">
        <h2>G·ª£i √Ω h√¥m nay</h2>

        <div className="hp-grid">
          {products.map((p) => (
            <div key={p.id} className="hp-card">
              <img
                src={p.images[0]?.imageUrl}
                alt={p.name}
                onClick={() => navigate(`/product/${p.id}`)}
              />
              <div className="hp-info">
                <span className="hp-brand">{p.brand}</span>
                <h3>{p.name}</h3>
                <p>{p.price.toLocaleString()} ‚Ç´</p>
              </div>
            </div>
          ))}
        </div>
      </section>

    </div>
  );
}
